inline:
.fern-button.primary {
  border-radius: 0.6rem;
  display: flex;
  flex-direction: row;
  gap: 0.75rem; /* Gap corresponds to the gap-3 class */
  font-size: 0.875rem; /* This corresponds to text-sm */
  font-weight: 500; /* This corresponds to font-medium */
  transition: all 0.8s ease-in-out;
  background-image: linear-gradient(to bottom, #42414b, #3a3941, #232227);
  border: 1px solid #42414b;
  color: #fff !important;
  box-shadow:
    inset 0 0 3px 0.5px rgba(252, 252, 253, 0.4),
    0 1px 2px 0 rgba(0, 0, 0, 0.05);
}

.fern-button.primary svg {
  fill: #fff !important;
  stroke: #fff !important;
  color: #fff !important;
}

.fern-button-content {
  /* color: #fff !important;
    fill: #fff !important;
    path: #fff !important;
    stroke: #fff !important; */
}

.fern-button.primary:hover {
  background-image: linear-gradient(to bottom, #5f5c6d, #42414b, #3a3941);
}

.fern-button.primary:active {
  outline: 2px solid rgba(116, 114, 133, 0.5);
  background-image: linear-gradient(to bottom, #3a3941, #3a3941, #3a3941);
  box-shadow: none;
}

.fern-header {
  background-color: #fff !important;
  border-bottom: 1px solid #eaecf0 !important;
}

.fern-header-tabs {
  background-color: #fff !important;
  border-bottom: 1px solid #eaecf0 !important;
}

figure.bg-tag-default-soft {
  background-color: #808080;
}

